import React from 'react';
import Image2 from '../images/img2_5.jpg';


const Projects = () => {
  return (
    <div id="projets" style={{backgroundImage: `url(${Image2})`}} className="flex flex-col flex-items w-full h-screen bg-cover bg-no-repeat bg-center">
       <div>ggggggggg</div>
       <div className='grid gap-4 grid-cols-1 sm:grid-cols-3 grid-rows-2 items-center p-8 h-full w-full mx-auto text-center text-white bg-black bg-opacity-75'>
         <div className='bg-black'>Site E-commerce</div>
         <div className='bg-black'>La serie de Breaking Bad</div>
         <div className='bg-black'>PortFolio</div>
         <div className='bg-black'>Site Argan Amlo</div>
       </div>  
    </div>
  )
}

export default Projects
